package com.rest.pojo;

// TODO: Auto-generated Javadoc
/**
 * The Class Cars.
 * @author pvedire
 */
public class Cars {
	
	/** The name. */
	private String name;
	
	/** The model. */
	private String model;
	
	/** The price. */
	private Long price;

	/**
	 * Gets the name.
	 *
	 * @return the name
	 */
	public String getName() {
		return name;
	}

	/**
	 * Sets the name.
	 *
	 * @param name the new name
	 */
	public void setName(String name) {
		this.name = name;
	}

	/**
	 * Gets the model.
	 *
	 * @return the model
	 */
	public String getModel() {
		return model;
	}

	/**
	 * Sets the model.
	 *
	 * @param model the new model
	 */
	public void setModel(String model) {
		this.model = model;
	}

	/**
	 * Gets the price.
	 *
	 * @return the price
	 */
	public Long getPrice() {
		return price;
	}

	/**
	 * Sets the price.
	 *
	 * @param price the new price
	 */
	public void setPrice(Long price) {
		this.price = price;
	}
	
	

}
